&lt;h3&gt;Cherry MX Switch - Electromechanical Swith w/ LED&lt;/h3&gt;

&lt;p&gt;Cherry MX Keyswitches are top-of-the-line mechanical keyboard switches. Theyre satisfyingly clicky, reliable up to tens-of-millions of key presses, and a standard in gaming and programming keyboards across the globe. This blue version Cherry MX Switch is favored by most due to its secondary internal actuator making it less likely to double-tap. If you are looking for a noticeably audible and high-quality key switch, this is the perfect option for you!&lt;/p&gt;

